import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import CalendarPage from './components/CalendarPage';
import BookingPage from './components/BookingPage';
import HeaderSelection from './HomePageComponents/HeaderSelection';

function App() {
  return (
    <>
    <div style="position: relative; width: 100%; height: 0; padding-top: 33.3333%;
 padding-bottom: 0; box-shadow: 0 2px 8px 0 rgba(63,69,81,0.16); margin-top: 1.6em; margin-bottom: 0.9em; overflow: hidden;
 border-radius: 8px; will-change: transform;">
  <iframe loading="lazy" style="position: absolute; width: 100%; height: 100%; top: 0; left: 0; border: none; padding: 0;margin: 0;"
    src="https://www.canva.com/design/DAGBvg2vx68/nevLhBoHOuOjkvrQYNxZeA/view?embed" allowfullscreen="allowfullscreen" allow="fullscreen">
  </iframe>
</div>
<a href="https:&#x2F;&#x2F;www.canva.com&#x2F;design&#x2F;DAGBvg2vx68&#x2F;nevLhBoHOuOjkvrQYNxZeA&#x2F;view?utm_content=DAGBvg2vx68&amp;utm_campaign=designshare&amp;utm_medium=embeds&amp;utm_source=link" target="_blank" rel="noopener">FITWIZZ</a> от Кристиян Стефанов
      <Navbar />
      <Routes>
        <Route path="/" element={<HeaderSelection />} />
        <Route path="/calendar" element={<CalendarPage />} />
        <Route path="/booking/:date" element={<BookingPage />} />
      </Routes>
    </>
  );
}

export default App;
